import React, { Component } from 'react'
import './App.css';

export class ListOfPeople extends Component {
    constructor(props){
        super(props)
        this.state = {
            personData : this.props
        }
        this.onDelete = this.onDelete.bind(this);
    }

    onDelete(e){
        console.log(e);
    }

    
    render() {
        return (
            <div>
                <div className = 'user-info'>
                   
                    {
                      this.state.personData.list.map(user =><tbody key = {user._id}>
                                                <section>
                                                  <p>{user.name}</p>
                                                  <p>{user.email}</p>
                                                  <p>{user.age}</p>
                                                  <button>Edit</button>
                                                  <button onClick = {this.onDelete(user._id)}>Delete</button>
                                                </section>
                                          </tbody>)
                    }

                  </div>
                
            </div>
        )
    }
}

export default ListOfPeople
